const PlasmicDescendants = {
  root: ["root", "dottedLine", "line2", "line3", "line4", "line5", "line6"],
  dottedLine: ["dottedLine"],
  line2: ["line2"],
  line3: ["line3"],
  line4: ["line4"],
  line5: ["line5"],
  line6: ["line6"]
} as const;
type NodeNameType = keyof typeof PlasmicDescendants;
type DescendantsType<T extends NodeNameType> =
  typeof PlasmicDescendants[T][number];
type NodeDefaultElementType = {
  root: "div";
  dottedLine: "svg";
  line2: "svg";
  line3: "svg";
  line4: "svg";
  line5: "svg";
  line6: "svg";
};

type ReservedPropsType = "variants" | "args" | "overrides";
type NodeOverridesType<T extends NodeNameType> = Pick<
  PlasmicRoadmap__OverridesType,
  DescendantsType<T>
>;
type NodeComponentProps<T extends NodeNameType> =
  // Explicitly specify variants, args, and overrides as objects
  {
    variants?: PlasmicRoadmap__VariantsArgs;
    args?: PlasmicRoadmap__ArgsType;
    overrides?: NodeOverridesType<T>;
  } & Omit<PlasmicRoadmap__VariantsArgs, ReservedPropsType> & // Specify variants directly as props
    // Specify args directly as props
    Omit<PlasmicRoadmap__ArgsType, ReservedPropsType> &
    // Specify overrides for each element directly as props
    Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
    > &
    // Specify props for the root element
    Omit<
      Partial<React.ComponentProps<NodeDefaultElementType[T]>>,
      ReservedPropsType | VariantPropType | ArgPropType | DescendantsType<T>
    >;

function makeNodeComponent<NodeName extends NodeNameType>(nodeName: NodeName) {
  type PropsType = NodeComponentProps<NodeName> & { key?: React.Key };
  const func = function <T extends PropsType>(
    props: T & StrictProps<T, PropsType>
  ) {
    const { variants, args, overrides } = React.useMemo(
      () =>
        deriveRenderOpts(props, {
          name: nodeName,
          descendantNames: [...PlasmicDescendants[nodeName]],
          internalArgPropNames: PlasmicRoadmap__ArgProps,
          internalVariantPropNames: PlasmicRoadmap__VariantProps
        }),
      [props, nodeName]
    );

    return PlasmicRoadmap__RenderFunc({
      variants,
      args,
      overrides,
      forNode: nodeName
    });
  };
  if (nodeName === "root") {
    func.displayName = "PlasmicRoadmap";
  } else {
    func.displayName = `PlasmicRoadmap.${nodeName}`;
  }
  return func;
}

export const PlasmicRoadmap = Object.assign(
  // Top-level PlasmicRoadmap renders the root element
  makeNodeComponent("root"),
  {
    // Helper components rendering sub-elements
    dottedLine: makeNodeComponent("dottedLine"),
    line2: makeNodeComponent("line2"),
    line3: makeNodeComponent("line3"),
    line4: makeNodeComponent("line4"),
    line5: makeNodeComponent("line5"),
    line6: makeNodeComponent("line6"),

    // Metadata about props expected for PlasmicRoadmap
    internalVariantProps: PlasmicRoadmap__VariantProps,
    internalArgProps: PlasmicRoadmap__ArgProps
  }
);

export default PlasmicRoadmap;
